import { Row, Col } from "react-bootstrap";

import style from "./css/Market.module.css";

const Market = () => {
  return (
    <>
      <Row className={style["background"]}>
        <Row>
          <Row>이적시장헤드</Row>
          <Row>
            <Row></Row>
            <Row></Row>
          </Row>
        </Row>
      </Row>
    </>
  );
};

export default Market;
